
import { LZString } from '../libs/lz-string.js'

/**
 * Shuffle an array
 */
function shuffle(array) {
    let currentIndex = array.length,  randomIndex

    // While there remain elements to shuffle.
    while (currentIndex != 0) {

        // Pick a remaining element.
        randomIndex = Math.floor(Math.random() * currentIndex)
        currentIndex--

        // And swap it with the current element.
        [array[currentIndex], array[randomIndex]] = [
            array[randomIndex], array[currentIndex]]
    }

    return array
}

let satlesEncoded = ""

function populateSatles() {
    return JSON.parse(LZString.decompressFromBase64(satlesEncoded))
}

function getTextWidth(text) {
    let el = document.createElement("span")
    el.textContent = text
    document.body.append(el)
    let width = el.offsetWidth
    el.remove()
    return width
}

function getChildIndex(node) {
    return Array.prototype.indexOf.call(node.parentNode.childNodes, node);
}

function formatCityCountry(satle) {
    return satle.city + ", " + satle.country
}

export { shuffle, populateSatles, getTextWidth, getChildIndex, formatCityCountry }

